import React, { useState } from 'react'
import io from 'socket.io-client'

const socket = io(
  'https://samsara-chat.herokuapp.com/chatroom/check-chat?token=6ba855c88f67c3fbf9a864ef617e41a696745fbb&receiver=saken2.0',
  'https://samsara-chat.herokuapp.com/docs#/default/check_chat_chatroom_check_chat_get',
  {
    withCredentials: true,  
    extraHeaders: {
      token: '6ba855c88f67c3fbf9a864ef617e41a696745fbb',
      receiver: 'saken2.0'
    }
  }
)
// const token = '8992b67715cedc3df67a40f3c989fce404b31966'
// const socket = io(`http://127.0.0.1:7000/?token=${token}`)

function Socket() {
  const [message, setMessage] = useState()
  console.log(message, 'message')
  const sendMessage = () => {
    socket.emit('message:', { message: message })
  }
  return (
    <>
      <input type="text" onChange={(e) => setMessage(e.target.value)} />
      <button onClick={sendMessage}>send message</button>
    </>
  )
}

export default Socket
